import React from 'react';
import images from '../images/frame2.png';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom

function Page3() {
  return (
    <div className="bg-blue-100 p-4">
      <h1 className="text-2xl font-semibold text-blue-900">Toad God 01</h1>
      <p className="text-gray-700 mt-2">Multiple Perspectives</p>
      <img src={images} alt="Toad God 01" className="w-full h-auto" />

      <Link to="/Page4.js">
      <h2>This is Page 3</h2>
        <button className="bg-blue-200 hover:bg-blue-600 text-white font-bold py-2 px-4 mt-4 rounded">
          Next
        </button>
      </Link>

    </div>
  );
}

export default Page3;
